Rock of Ages (2012 film)

Rock of Ages is a 2012 American musical comedy film directed by Adam Shankman. The film is an adaptation of the 2006 rock jukebox Broadway musical of the same name by Chris D'Arienzo. Originally scheduled to enter production in summer 2010 for a 2011 release, it eventually started production in May 2011 and was released on June 15, 2012.
The film stars country singer Julianne Hough and Diego Boneta leading an ensemble cast that includes Russell Brand, Paul Giamatti, Catherine Zeta-Jones, Malin Ãƒâ€¦kerman, Mary J. Blige, Alec Baldwin, and Tom Cruise. The film features the music of several 1980s rock artists including Bon Jovi, Guns N' Roses, David Lee Roth, Def Leppard, Journey, Poison, Twisted Sister, Whitesnake, and others.
Receiving mixed reviews, the film was a box office bomb, as their gross of $50 million failed to beat its $75 million budget.

